// export default App;

/*
  Tailwind-enhanced Personal Profile Web Application
  Updated with custom CSS/Tailwind utilities for modern UI/UX enhancements
*/

import React from 'react';
import './App.css';

const Navbar = () => (
  <nav className="fixed w-full z-10 bg-white shadow-lg">
    <div className="max-w-6xl mx-auto px-6 lg:px-8 flex justify-between items-center h-16">
      <h1 className="text-2xl font-extrabold text-gray-800">Buscuker Đức</h1>
      <ul className="flex space-x-6">
        {['about','projects','contact'].map(section => (
          <li key={section} className="group">
            <a
              href={`#${section}`}
              className="relative text-gray-700 uppercase tracking-wide text-sm hover:text-blue-500 transition-colors duration-300"
            >
              {section}
              <span className="absolute left-0 -bottom-1 w-0 h-0.5 bg-blue-500 group-hover:w-full transition-all duration-300"></span>
            </a>
          </li>
        ))}
      </ul>
    </div>
  </nav>
);

const Hero = () => (
  <section
    id="hero"
    className="flex flex-col items-center justify-center h-screen bg-gradient-to-r from-blue-50 to-white"
    style={{ scrollBehavior: 'smooth' }}
  >
    <h2 className="text-6xl md:text-7xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-blue-600 to-teal-400 animate-pulse">
      Hello, I’m Anh
    </h2>
    <p className="mt-4 text-xl text-gray-600 max-w-2xl text-center">
      A passionate developer specializing in React, Tailwind CSS, and modern web experiences.
    </p>
    <a
      href="#projects"
      className="mt-8 px-8 py-3 bg-gradient-to-r from-blue-500 to-purple-600 text-white rounded-full shadow-lg hover:from-purple-600 hover:to-blue-500 transition-all duration-500 transform hover:scale-105"
    >
      Explore Projects
    </a>
  </section>
);

const About = () => (
  <section id="about" className="py-24 px-6 lg:px-8 bg-white">
    <h3 className="text-4xl font-semibold mb-6 text-gray-800">About Me</h3>
    <p className="text-gray-700 leading-relaxed max-w-3xl tracking-wide">
      I'm a frontend developer with 3+ years building responsive, high-performance web applications. I love crafting clean interfaces, optimizing UX, and staying up-to-date with the latest web technologies.
    </p>
  </section>
);

const Projects = () => (
  <section id="projects" className="py-24 px-6 lg:px-8 bg-gray-50">
    <h3 className="text-4xl font-semibold mb-6 text-gray-800">Projects</h3>
    <div className="grid grid-cols-1 md:grid-cols-2 gap-8">
      {[1,2].map(i => (
        <div
          key={i}
          className="p-6 bg-white rounded-2xl shadow-lg hover:shadow-2xl transform hover:-translate-y-2 transition-all duration-300"
        >
          <h4 className="text-2xl font-bold mb-2">Project {i} Title</h4>
          <p className="text-gray-600 mb-4">
            Short description of project {i}. Tech stack: React, Tailwind CSS, APIs.
          </p>
          <a
            href="#"
            className="inline-block px-4 py-2 border border-blue-500 text-blue-500 rounded-full hover:bg-blue-500 hover:text-white transition-colors duration-300"
          >
            View on GitHub
          </a>
        </div>
      ))}
    </div>
  </section>
);

const Contact = () => (
  <section id="contact" className="py-24 px-6 lg:px-8 bg-white">
    <h3 className="text-4xl font-semibold mb-6 text-gray-800">Contact Me</h3>
    <form className="max-w-md mx-auto space-y-6">
      {[
        { label: 'Name', type: 'text', name: 'name' },
        { label: 'Email', type: 'email', name: 'email' },
      ].map(field => (
        <div key={field.name}>
          <label className="block text-gray-700 mb-2">{field.label}</label>
          <input
            type={field.type}
            name={field.name}
            className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent transition duration-300"
            placeholder={field.label}
          />
        </div>
      ))}
      <div>
        <label className="block text-gray-700 mb-2">Message</label>
        <textarea
          name="message"
          rows="4"
          className="w-full px-4 py-3 border border-gray-300 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500 focus:border-transparent transition duration-300"
          placeholder="Your message..."
        ></textarea>
      </div>
      <button
        type="submit"
        className="w-full py-3 bg-gradient-to-r from-purple-600 to-blue-500 text-white font-semibold rounded-full shadow-lg hover:from-blue-500 hover:to-purple-600 transform hover:scale-105 transition duration-300"
      >
        Send Message
      </button>
    </form>
  </section>
);

const Footer = () => (
  <footer className="py-6 bg-gray-900 text-gray-400 text-center">
    <p>&copy; {new Date().getFullYear()} Your Name. All rights reserved.</p>
  </footer>
);

export default function App() {
  return (
    <div className="font-sans antialiased">
      <Navbar />
      <Hero />
      <About />
      <Projects />
      <Contact />
      <Footer />
    </div>
  );
}
